import { Form, Input, Button, Divider , Layout } from 'antd';
import { UserOutlined, LockOutlined, FacebookFilled, GooglePlusSquareFilled, HomeOutlined } from '@ant-design/icons';
import Link from "next/link";
import axios from "axios";
import catchErrors from "../utils/catchErrors";
import baseUrl from "../utils/baseUrl";

const {Content} = Layout;

const INITIAL_USER = {
  email: "",
  password: ""
};



function Login() {

  const [user, setUser] = React.useState(INITIAL_USER);


  function handleChange(event) {
    const { name, value } = event.target;
    setUser(prevState => ({ ...prevState, [name]: value }));
  }




  return (
    <>
      <Layout className="layout">
        <Content className="content" >
          <div className="site-layout-background">
            <h1> Login </h1>
            <br />
            <Form>

              <Form.Item name="username">
                <Input
                  name="email"
                  className="input"
                  size="large"
                  prefix={<UserOutlined />}
                  placeholder="Username" />
              </Form.Item>

              <Form.Item name="password">
                <Input
                  name="password"
                  className="input"
                  size="large"
                  prefix={<LockOutlined />}
                  type="password"
                  placeholder="Password"
                />
              </Form.Item>

              <Form.Item>
                <a href="">
                  Forgot password
                </a>
              </Form.Item>

              <Form.Item >
                <Button type="primary" htmlType="submit" shape="round" size="large">
                  Log in
                </Button>
              </Form.Item>

            </Form>

            <Button  shape="round" icon={<FacebookFilled/>} size="large">
              Sign in with Facebook
            </Button>
            <Divider style={{margin:"2px"}}/>
            <Button  shape="round" icon={<GooglePlusSquareFilled/>} size="large">
              Sign in with Google
            </Button>

          </div>
        </Content>
      </Layout>
    </>
  );
}

export default Login;
